  import React from 'react';
  import Swiper from 'react-id-swiper';
  import 'swiper/swiper.scss';
  import CarAd2 from './imgs/Car_ad2.png';
  import CarAd3 from './imgs/car_ad3.png';
  import CarAd4 from './imgs/car_ad4.png';





  const Slider = () => {
    const params = {
      spaceBetween: 30,
      centeredSlides: true,
      autoplay: {
        delay: 2500,
        disableOnInteraction: false
      },
      pagination: {
        el: '.swiper-pagination',
        clickable: true
      },
      navigation: {
        nextEl: '.swiper-button-next',
        prevEl: '.swiper-button-prev'
      }
    }
    return (
    <div className="slider">
      <Swiper {...params}>
        <div><img className="slide_picture" src={CarAd2} alt="" id="1"/></div>
        <div><img className="slide_picture" src={CarAd3} alt="" id="2"/></div>
        <div><img className="slide_picture" src={CarAd4} alt="" id="3"/></div>

      </Swiper>
      </div>
    )
  };
  export default Slider;
